class FileProvider extends Provider {

    FileProvider(String url) {

        HttpRequest request = new HttpRequest();
        request.open('GET', url);
        request.onLoadEnd.listen((e) {
            var datas = JSON.decode(request.responseText);
            for (var series in datas) {
                String name = series[0];
                List<num> data = series[1];
                this.sendData(data);
            }
        });
        request.send('');
    }
}

